import React, { useEffect } from 'react';
import NewGallery from './pages/NewGallery';

function App() {
  useEffect(() => {
    document.title = 'AWS S3 image';
  }, []);
  return (
    <>
      <NewGallery />
    </>
  );
}

export default App;
